inline int isprime(int x) {
  if (x == 1) return 1;
  if (x == 2) return 0;
  for (int i = 2; i * i <= x; ++i) {
    if (x % i == 0) return 0;
  }
  return 1;
}

inline void solve() {
  int n;
  cin >> n;
  int ans = tab[n / B];
  for (int i = (n / B) * B + 1; i <= n; ++i) {
    if ((i & 3) == 3) ans += isprime(i);
    else if ((i & 3) == 0) {
      if ((i&7) == 4) ans += isprime(i>>2);
      else if ((i & 15) == 0) ans += isprime(i>>4);
    }
  }
  println(ans);
}

